'use strict';
//@@DocInclude
//@@DocBrief("The login error class")
class LoginError {
    static get CODE_NOT_SPECIFIED() { return 0; }
    static get CODE_EMPTY_PARAMETER() { return 1; }
    static get CODE_INCORRECT_PIN() { return 2; }
    static get CODE_WRONG_USERNAME_OR_PASSWORD() { return 3; }
    static get CODE_LOCKED_USER() { return 4; }
    static get CODE_SERVER_ERROR() { return 5; }
    static get CODE_INCORRECT_TRADING_SYSTEM_URL() { return 6; }
    static get CODE_INCORRECT_CONNECTION_NAME() { return 7; }
    static get CODE_TIMEOUT() { return 8; }
    static get CODE_INVALID_OPERATION() { return 9; }
    code;
    message;
    getMessage() {
        return this.message;
    }
    getCode() {
        return this.code;
    }
    static create(code, message) {
        let instance;
        instance = new LoginError();
        instance.code = code;
        instance.message = message;
        return instance;
    }
}
module.exports = LoginError
